import { Navbar } from "../Layout/Navbar";
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { getAllMaps } from "./HomeBehavior";
import "./style.css";
export const HomePage = () => {
  let nav = useNavigate();
  const [GetAllmap, setGetAllMap] = useState([]);

  const getAllMap = async () => {
    try {
      const getMap = await getAllMaps();

      if (getMap.success) {
        setGetAllMap(getMap.Map_of_User.Maps);
      }
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    // if (!localStorage.getItem("token")) {
    //   return nav("/login");
    // }
    getAllMap();
    console.log("Map", GetAllmap);
  });
  return (
    <>
      <Navbar></Navbar>
      <div style={{ display: "flex" }}>
        <ul className="cssforUl">
          {GetAllmap &&
            GetAllmap.map((item, index) => <li>{GetAllmap[index].name}</li>)}
        </ul>
      </div>
    </>
  );
};
